%[text] # Detect Vanishing Gradients in Deep Neural Networks by Plotting Gradient Distributions
%[text] This example shows how to monitor vanishing gradients while training a deep neural network.
%[text] A common problem in deep network training is *vanishing gradients*. Deep learning training algorithms aim to minimize the loss by adjusting the learnable parameters of the network during training. Gradient-based training algorithms determine the level of adjustment using the gradients of the loss function with respect to the current learnable parameters. For earlier layers, the gradient computation uses the propagated gradients from the previous layers. Therefore, when a network contains activation functions that always produce gradient values less than 1, the value of the gradients can become increasingly small as the updating algorithm moves towards the initial layers. As a result, early layers in the network can receive a gradient that is vanishingly small and, therefore, the network is unable to learn. However, if the gradient of the activation function is always greater than or equal to 1, the gradients can flow through the network, reducing the chance of vanishing gradients.
%[text] This example trains two networks with different activation functions and compares their gradient distributions.
%[text] 한글 추가
%[text] ## Compare Activation Functions
%[text] To illustrate the different properties of activation functions, compare two common deep learning activation functions: ReLU and sigmoid. 
%[text] $\\textrm{ReLU}\\left(x\\right)=\\left\\lbrace \\begin{array}{ll}\nx & x\\ge 0\\\\\n0 & x\<0\n\\end{array}\\right.${"editStyle":"visual"} $\\textrm{Sigmoid}\\left(x\\right)={\\left(1+\\exp \\left(-x\\right)\\right)}^{-1\\;}${"editStyle":"visual"}
%[text] Evaluate the gradients of the ReLU and sigmoid activation functions.
x = linspace(-5,5,1000);

reluActivation = max(0,x);
reluGradient = gradient(reluActivation,0.01);

sigmoidActivation = 1./(1 + exp(-x));
sigmoidGradient = gradient(sigmoidActivation,0.01);
%[text] Plot the ReLU and sigmoid activation functions and their gradients.
figure %[output:1d18385b]
tiledlayout(1,2) %[output:1d18385b]

nexttile %[output:1d18385b]
plot(x,[reluActivation;reluGradient]) %[output:1d18385b]
legend("ReLU","Gradient of ReLU") %[output:1d18385b]

nexttile %[output:1d18385b]
plot(x,[sigmoidActivation;sigmoidGradient]) %[output:1d18385b]
legend("Sigmoid","Gradient of Sigmoid") %[output:1d18385b]
%[text] The ReLU gradient is either 0 or 1 for the entire range. Therefore, the gradient does not become increasingly small as it backpropagates through the network, reducing the chance of vanishing gradients. The sigmoid gradient curve is less than 1 for the entire range. Therefore, a network containing sigmoid activation layers can suffer from the vanishing gradient problem.
%%
%[text] ## **Load Data**
%[text] Load sample data consisting of 5000 synthetic images of handwritten digits and their labels using `digitTrain4DArrayData`.
[XTrain,TTrain] = digitTrain4DArrayData;
numObservations = length(TTrain);
%[text] To automatically resize the training images, use an augmented image datastore.
inputSize = [28,28,1];
augimdsTrain = augmentedImageDatastore(inputSize(1:2),XTrain,TTrain);
%[text] Determine the number of classes in the training data.
classes = categories(TTrain);
numClasses = numel(classes);
%%
%[text] ## **Define Network**
%[text] To compare the effect of the activation layer, construct two networks. Each network contains either ReLU or sigmoid activation layers separating four fully connected layers. By comparing the training progress of these two networks, you can see the impact of the activation layer during training. These networks are for demonstration purposes only. For an example showing how to create and train a simple image classification network, see [Create Simple Deep Learning Network for Classification](docid:nnet_ug#example-ex86195632).
activationTypes = ["ReLU","Sigmoid"];
numNetworks = length(activationTypes);

for i = 1:numNetworks
    activationType = activationTypes(i);

    switch activationType
        case "ReLU"
            activationLayer = reluLayer;
        case "Sigmoid"
            activationLayer = sigmoidLayer;
    end

    layers = [
        imageInputLayer(inputSize,Normalization="none")
        fullyConnectedLayer(10)
        activationLayer
        fullyConnectedLayer(10)
        activationLayer
        fullyConnectedLayer(10)
        activationLayer
        fullyConnectedLayer(numClasses)
        softmaxLayer];

    % Create a dlnetwork object from the layers.
    networks{i} = dlnetwork(layers);
end
%[text] ## **Define Model Loss Function**
%[text] Create the function `modelLoss`, listed at the end of the example, which takes as input a `dlnetwork` object and a mini-batch of input data with corresponding labels and returns the loss and the gradients of the loss with respect to the learnable parameters in the network.
%[text] ## **Specify Training Options**
%[text] Train for 50 epochs with a mini-batch size of 128.
numEpochs = 50;
miniBatchSize = 128;
%%
%[text] ## Train Models
%[text] To compare the two networks, track the loss and average gradients for each layer in each network. Each network contains four learnable layers.
numIterations = numEpochs*ceil(numObservations/miniBatchSize);
numLearnableLayers = 4;

losses = zeros(numIterations,numNetworks);
meanGradients = zeros(numIterations,numNetworks,numLearnableLayers);
%[text] Create a `minibatchqueue` object that processes and manages mini-batches of images during training. For each mini-batch:
%[text] - Use the custom mini-batch preprocessing function `preprocessMiniBatch`, defined at the end of this example, to convert the labels to one-hot encoded variables.
%[text] - Format the image data with the dimension labels `"SSCB"` (spatial, spatial, channel, batch). By default, the `minibatchqueue` object converts the data to `dlarray` objects with underlying type single. Do not add a format to the class labels.
%[text] - Train on a GPU if one is available. By default, the `minibatchqueue` object converts each output to a `gpuArray` if a GPU is available.  Using a GPU requires Parallel Computing Toolbox™ and a supported GPU device. For information on supported devices, see [GPU Support by Release](docid:distcomp_ug#mw_57e04559-0b60-42d5-ad55-e77ec5f5865f). \
mbq = minibatchqueue(augimdsTrain,...
    MiniBatchSize=miniBatchSize,...
    MiniBatchFcn=@preprocessMiniBatch,...
    MiniBatchFormat=["SSCB",""]);
%[text] Loop over each of the networks. For each network:
%[text] - Find the indices of the weights and the names of the layers with weights.
%[text] - Initialize the plots of the weight distributions using the supporting function [`setupGradientDistributionAxes`](internal:H_DD8137FF), defined at the end of this example.
%[text] - Train the network using a custom training loop. \
%[text] For each epoch of the custom training loop, shuffle the data and loop over mini-batches of data. For each mini-batch:
%[text] - Evaluate the model loss and gradients using the `dlfeval` and `modelLoss` functions.
%[text] - Update the network parameters using the `adamupdate` function.
%[text] - Save the average gradient value for each layer at each iteration. \
%[text] At the end of each epoch, plot the gradient distributions of the weights for each learnable layer using the supporting function [`plotGradientDistributions`](internal:H_03872F66), defined at the end of this example.
for activationIdx = 1:numNetworks %[output:group:41732a87]

    activationName =  activationTypes(activationIdx);
    net = networks{activationIdx};

    % Find the indices of the weight learnables.
    weightIdx = ismember(net.Learnables.Parameter,"Weights");

    % Find the names of the layers with weights.
    weightLayerNames = join([net.Learnables.Layer(weightIdx),...
        net.Learnables.Parameter(weightIdx)]);

    % Prepare axes to display the weight distributions for each epoch
    % using the supporting function setupGradientDistributionAxes.
    plotSetup = setupGradientDistributionAxes(activationName,weightLayerNames,numEpochs); %[output:8ef34568] %[output:8883f2d5]

    % Initialize parameters for the Adam training algorithm.
    averageGrad = [];
    averageSqGrad = [];

    % Train the network using a custom training loop.
    iteration = 0;
    start = tic;

    % Reset minibatchqueue to the start of the data.
    reset(mbq);

    % Loop over epochs.
    for epoch = 1:numEpochs
        % Shuffle data.
        shuffle(mbq);

        % Loop over mini-batches.
        while hasdata(mbq)
            iteration = iteration + 1;

            % Read mini-batch of data.
            [X,T] = next(mbq);

            % Evaluate the model loss and gradients using dlfeval and the
            % modelLoss function.
            [loss,gradients] = dlfeval(@modelLoss,net,X,T);

            % Update the network parameters using the Adam optimizer.
            [net,averageGrad,averageSqGrad] = adamupdate(net,gradients,averageGrad,averageSqGrad,iteration);

            % Record the loss at every iteration.
            losses(iteration,activationIdx) = loss;

            % Record the average gradient of each learnable layer at each iteration.
            gradientValues = gradients.Value(weightIdx);
            for ii = 1:numLearnableLayers
                meanGradients(iteration,activationIdx,ii) = mean(gradientValues{ii},"all");
            end
        end

        % At the end of each epoch, plot the gradient distributions of the weights
        % of each learnable layer using the supporting function
        % plotGradientDistributions.
        gradientValues = gradients.Value(weightIdx);
        plotGradientDistributions(plotSetup,gradientValues,epoch)
    end
end %[output:group:41732a87]
%[text] The gradient distribution plots show that the sigmoid network suffers from vanishingly small gradients. This effect becomes increasingly noticeable as the gradients flow back through the network toward the earlier layers.
%%
%[text] ## **Compare Losses**
%[text] Compare the losses of the trained networks.
figure %[output:5ac7bbc5]
plot(losses) %[output:5ac7bbc5]
xlabel("Iteration") %[output:5ac7bbc5]
ylabel("Loss") %[output:5ac7bbc5]
legend(activationTypes) %[output:5ac7bbc5]
%[text] The loss for the sigmoid network decreases slower than the loss for the ReLU network. Therefore, for this model, using ReLU activation layers results in faster learning.
%%
%[text] ## **Compare Mean Gradients**
%[text] Compare the average gradient for each layer in each training iteration.
figure %[output:3063e7b0]
tiledlayout("flow") %[output:3063e7b0]
for ii = 1:numLearnableLayers %[output:group:2d4b3c7a]
    nexttile %[output:3063e7b0]
    plot(meanGradients(:,:,ii))
    xlabel("Iteration")
    ylabel("Average Gradient")
    title(weightLayerNames(ii))
    legend(activationTypes)
end %[output:group:2d4b3c7a]
%[text] The average gradient plot is consistent with the results seen in the gradient distribution plots. For the network with sigmoid layers, the range of values for the gradients is very small and centered around 0. In comparison, the network with ReLU layers has a much wider range of gradients, reducing the chance of vanishing gradients and increasing the rate of learning.
%%
%[text] ## **Supporting Functions**
%[text] ### **Model Loss Function**
%[text] The `modelLoss` function takes as input the `dlnetwork` object `net` and a mini-batch of input data `X` with corresponding targets `T` containing the labels, and returns the loss and the gradients of the loss with respect to the learnable parameters.
function [loss,gradients] = modelLoss(net,X,T)
Y = forward(net,X);

loss = crossentropy(Y,T);
gradients = dlgradient(loss,net.Learnables);
end
%[text] ### **Mini Batch Preprocessing Function**
%[text] The `preprocessMiniBatch` function preprocesses a mini-batch of predictors and labels using the following steps:
%[text] - Preprocess the images using the `preprocessMiniBatchPredictors` function.
%[text] - Extract the label data from the incoming cell array and concatenate the data into a categorical array along the second dimension.
%[text] - One-hot encode the categorical labels into numeric arrays. Encoding into the first dimension produces an encoded array that matches the shape of the network output. \
function [X,T] = preprocessMiniBatch(XCell,TCell)
% Preprocess predictors.
X = preprocessMiniBatchPredictors(XCell);

% Extract label data from cell and concatenate.
T = cat(2,TCell{1:end});

% One-hot encode labels.
T = onehotencode(T,1);
end
%[text] ### **Mini-Batch Predictors Preprocessing Function**
%[text] The `preprocessMiniBatchPredictors` function preprocesses a mini-batch of predictors by extracting the image data from the input cell array and concatenating it into a numeric array. For grayscale input, concatenating over the fourth dimension adds a third dimension to each image to use as a singleton channel dimension.
function X = preprocessMiniBatchPredictors(XCell)
% Concatenate.
X = cat(4,XCell{1:end});
end
%[text] ### Calculate Distribution
%[text] The `gradientDistributions` function computes the histogram values and returns the bin centers and histogram counts.
function [centers,counts] = gradientDistributions(values)
% Get the histogram count for the values.
[counts,edges] = histcounts(values,30);

% histcounts returns edges of the bins. To get the bin centers,
% calculate the midpoints between consecutive elements of the edges.
centers =  edges(1:end-1) + diff(edges)/2;
end
%[text] %[text:anchor:H_DD8137FF] ### Create Gradient Distribution Plot Axes
%[text] The `setupGradientDistributionAxes` function creates axes suitable for plotting the gradient distribution plots in 3-D. This function returns a structure array containing a `TiledChartLayout` object and a colormap that act as input to the `plotGradientDistributions` supporting function.
function plotSetup = setupGradientDistributionAxes(activationName,weightLayerNames,numEpochs)
f = figure;
t = tiledlayout(f,"flow",TileSpacing="tight");
t.Title.String = "Gradient Distributions with " + activationName + " Layers";

% To avoid updating the same values every epoch, set up axis 
% information before the training loop.
for i = 1 : numel(weightLayerNames)
    tiledAx = nexttile(t,i);

    % Set up the label names and titles.
    xlabel(tiledAx,"Gradients");
    ylabel(tiledAx,"Epochs");
    zlabel(tiledAx,"Counts");
    title(tiledAx,weightLayerNames(i));

    % Rotate the view.
    view(tiledAx, [-130, 50]);
    xlim(tiledAx,[-0.5,0.5]);
    ylim(tiledAx,[1,Inf]);
end

plotSetup.ColorMap = parula(numEpochs);
plotSetup.TiledLayout = t;
end
%[text] %[text:anchor:H_03872F66] ### **Plot Gradient Distributions**
%[text] The `plotGradientDistributions` function takes as input a structure array containing a `TiledChartLayout` object and a colormap, and an array of values (for example, layer gradients) at a specific epoch, and plots smoothed histograms in 3-D. Use the supporting function `setupGradientDistributionAxes` to generate a suitable structure array input.
function plotGradientDistributions(plotSetup,gradientValues,epoch)

for w = 1:numel(gradientValues)
    nexttile(plotSetup.TiledLayout,w)
    color = plotSetup.ColorMap(epoch,:);

    values = extractdata(gradientValues{w});

    % Get the centers and counts for the distribution.
    [centers,counts] = gradientDistributions(values);

    % Plot the gradient values on the x axis, the epochs on the y axis, and the
    % counts on the z axis. Set the edge color as white to more easily distinguish
    % between the different histograms.
    hold("on");
    fill3(centers,zeros(size(counts))+epoch,counts,color,EdgeColor="#D9D9D9");
    hold("off")
    drawnow
end
end
